        "vaeua-gui-eua.sas.van.control.initialValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor inicial (predefinido) para o controlo. O valor inicial é selecionado na primeira vez que um utilizador abre o relatório, ou quando um utilizador seleciona <span class\\="xis-windowItem">Restaurar estado de relatório predefinido</span>. </p><div class\\="xis-paragraph">Introduza um valor no campo de texto ou especifique uma das seguintes opções\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que a seleção é guardada como valor inicial quando se guarda o relatório. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Primeiro</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> Especifica que o primeiro valor no controlo é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o valor do parâmetro que selecionar é o valor inicial para o controlo.</p><p class\\="xis-paraSimple">Só pode selecionar um parâmetro se já existir um parâmetro com o tipo de dados apropriado.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Se o valor inicial não estiver na consulta de dados (por exemplo, devido a um filtro) e o controlo não for necessário, então o controlo não tem valor inicial. Se o controlo for necessário, o primeiro valor é selecionado como valor inicial.</p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.termWeight.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Tratamento de sobreposições</span> especifica a ação efetuada para apresentar as etiquetas das barras quando não há espaço suficiente para apresentá-las e elas sobrepõem-se.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Automático</span></td><td>ajusta as etiquetas automaticamente.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Nenhum</span></td><td>não efetua tratamento de sobreposições.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Reduzir o número de categorias personalizadas para eliminar o problema seguinte. Por exemplo, para eliminar problemas de baixa prioridade, reduza o número de categorias personalizadas no seu relatório para 25 ou menos.</p><p class\\="xis-paragraph">Prioridade baixa\\: contém &gt; 25 categorias personalizadas</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useEntityExtraction.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Determina se o extrator de entidade utiliza a lista padrão de entidades.</p></section>',
