        "vaeua-gui-eua.Properties.partialdependence.numObs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número máximo da amostra de observações a recolher dos dados de entrada usados para gerar os modelos de predição apresentados no gráfico de Dependência Parcial.</p></section>',
