        "vaeua-gui-eua.sas.van.Options.alternativeText.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica um nome com significado e acessível para um objeto. O texto é anunciado por um leitor de ecrã quando um utilizador navega para o objeto.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Inclui ligações entre cada neurónio de entrada e cada neurónio de saída na rede.</p></section>',
        "vaeua-gui-eua.properties.sankey.compress.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.factmac.learnStep.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Visualização de valores de marcas de escala</span> especifica o método utilizado para ajustar os valores de marcas de escala no eixo X. Pode selecionar <span class\\="xis-windowItem">Reduzir automaticamente a sobreposição</span> ou <span class\\="xis-windowItem">Orientação Fixa</span>.</p><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Reduzir automaticamente a sobreposição</span> só é aplicada quando os valores de marcas de escala se sobrepõem. Pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Escalonar, truncar, eliminar</span></td><td>desloca os valores alternadamente para cima e para baixo, elimina carateres dos valores de marcação e, em seguida, elimina valores de marcação.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotação de 45°</span></td><td>roda todos os valores de marcas de escala 45° na diagonal.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Escalonar, truncar</span></td><td>desloca os valores de marcas de escala alternadamente para cima e para baixo e, em seguida, corta carateres dos valores de marcas de escala.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Truncar</span></td><td>elimina carateres dos valores das marcas de escala.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Truncar, rodar 45°</span></td><td>elimina carateres dos valores de marcas de escala e roda todos os valores de marcas de escala 45° na diagonal.</td></tr></table></div>                 </div><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Orientação fixa</span> é sempre aplicada e define a orientação dos valores. Pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Horizontal</span></td><td>apresenta os valores das marcas de escala horizontalmente.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotação de 45°</span></td><td>roda todos os valores de marcas de escala 45° na diagonal.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rodar 45°, eliminar</span></td><td>roda todos os valores de marcas de escala 45° na diagonal e depois elimina valores de marcas de escala.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Efetua uma seleção de variável inversa rápida para determinar as variáveis consideradas para criar o modelo. Apenas são consideradas variáveis com valores <span class\\="xis-userSuppliedValue">p</span> inferiores ao nível de significância especificado.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">O seu relatório demora muito tempo a carregar a primeira página. Se o SAS Visual Analytics identificar problemas de desempenho para além de tempos de carregamento lentos, corrija primeiro estes problemas. Caso não sejam identificados outros problemas de desempenho, contacte o seu administrador para determinar se existem outros fatores que afetem o seu relatório. Por exemplo, uma ligação lenta pode causar o carregamento lento de um relatório.</p><p class\\="xis-paragraph">Prioridade baixa\\: demora &gt;\\= 5 segundos</p><p class\\="xis-paragraph">Prioridade média\\: demora &gt;\\= 10 segundos</p><p class\\="xis-paragraph">Prioridade alta\\: demora &gt;\\= 25 segundos</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a função de ativação utilizada para criar a camada de saída quando se utiliza uma distribuição normal para modelar a resposta. A função de ativação exponencial é utilizada com uma distribuição gama ou Poisson. </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Incluir itens de dados relacionados (atribuições de funções, filtros, etc.) com o objeto guardado.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.heatmap.binCountNotApplicableToNonMeasures.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.initialAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o método usado para obter as estimativas iniciais para as atribuições de cluster.</p></section>',
