        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor de alfa para a medida de complexidade de custo utilizada para podar a árvore de regressão. Um valor de alfa maior cria uma árvore mais pequena.</p></section>',
        "vaeua-gui-eua.usingTimeZones.help.tip.txt": "Que fuso horário posso selecionar para múltiplas datas?",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica se as ligações de texto para esta página estão ocultas para utilizadores que não as consigam visualizar. </p><p class\\="xis-paragraph">Se não ativar esta opção, os utilizadores que não têm acesso verão uma mensagem de notificação quando tentarem seguir a ligação de texto.</p></section>',
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.tip.txt": "Mais informações acerca desta opção ",
