        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Determina é utilizada uma lista de exclusões. Uma lista de exclusões é uma coleção simples de palavras com baixo teor informativo ou irrelevantes que queira remover do texto. As palavras devem ser guardadas como conjunto de dados SAS carregada no servidor CAS.</p></section>',
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.tip.txt": "Mais informações acerca desta opção ",
