        "vaeua-gui-eua.sas.van.ReportReview.HighDataObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Reduzir o número de objetos para eliminar os problemas seguintes. Por exemplo, para eliminar problemas de prioridade média, reduza o número de cálculos no seu relatório para 12 ou menos.</p><p class\\="xis-paragraph">Prioridade baixa\\: contém &gt; 7 objetos na página</p><p class\\="xis-paragraph">Prioridade média\\: contém &gt; 12 objetos na página</p></section>',
