        "vaeua-gui-eua.Properties.svm.missingvalue.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor inicial (predefinido) para o controlo. O valor inicial é selecionado na primeira vez que um utilizador abre o relatório, ou quando um utilizador seleciona <span class\\="xis-windowItem">Restaurar estado de relatório predefinido</span>. </p><div class\\="xis-paragraph">Introduza um valor no campo de texto ou especifique uma das seguintes opções\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que a seleção é guardada como valor inicial quando se guarda o relatório. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valor Mínimo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> Especifica que o valor mais baixo no controlo é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valor Máximo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> Especifica que o maior valor no controlo é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o valor do parâmetro que selecionar é o valor inicial para o controlo.</p><p class\\="xis-paraSimple">Só pode selecionar um parâmetro se já existir um parâmetro com o tipo de dados apropriado.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.tip.txt": "Mais informações acerca desta opção ",
