        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Ordem das ligações</span> especifica como ligar os pontos de dados para formar as linhas do gráfico. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Eixo</span></td><td>liga os pontos de dados à medida que ocorrem da esquerda para a direita no eixo X.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Dados</span></td><td>liga os pontos de dados pela ordem em que são lidos a partir pela função X.</td></tr></table></div>                 </div><p class\\="xis-paragraph">Pode utilizar este valor para assegurar uma ligação ordenada quando os dados de entrada não são ordenados pela função X.</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número máximo de vetores de suporte. O número real de vetores de suporte pode ser ligeiramente superior ao número especificado devido à natureza do método do conjunto ativo.</p></section>',
