        "vaeua-gui-eua.Properties.svm.missingvalue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Alarga o modelo para incluir observações com valores em falta e para incluir valores em falta na variável de resposta. Os preditores categóricos tratam um valor em falta como um valor separado. Um preditor contínuo substitui um valor em falta pela média do preditor.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.maximumSeconds.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utiliza o tempo máximo predefinido para treinar a rede neuronal. A predefinição é 270. </p></section>',
