        "vaeua-gui-eua.yAxisTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Visualização de valores de marcas de escala</span> especifica o método utilizado para ajustar os valores de marcas de escala no eixo Y. Pode especificar o seguinte\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Eliminar alguns</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">diminui alguns valores de marcas de escala.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Mostrar tudo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">apresenta todos os valores de marcas de escala.</p></dd></dl></div>                 </div></section>',
