        "vaeua-gui-eua.react.va.geo.search.exitSelectionMode.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Sair do modo de seleção impossibilita clicar no mapa para selecionar uma localização. Para reativar o modo de seleção, selecione um campo de <span class\\="xis-windowItem">Localização</span> vazio.</p></section>',
