        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.table.detailData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica que os dados não são agregados.</p><p class\\="xis-paragraph">Esta opção está disponível quando usa dados agregados e aplica-se às rankings e aos filtros de pós-agregação. A opção não está disponível se a tabela de lista já tiver um filtro agregado ou se houver uma ranking com a opção <span class\\="xis-windowItem">Todos os Outros</span> especificada.</p><p class\\="xis-paragraph">Uma tabela de lista que apresente dados detalhados não pode ser a origem de uma ação ou ligação.</p></section>',
