        "vaeua-gui-eua.Properties.tweedie.powerSpecification.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a forma como é determinado o parâmetro de potência Tweedie.</p></section>',
        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.ReportReview.LowPercentageUsedColumns.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Remover as colunas não utilizadas na origem de dados do relatório para eliminar o problema seguinte. Por exemplo, para eliminar os problemas de prioridade baixa, certifique-se de que o seu relatório utiliza 10% ou mais das colunas na origem de dados.</p><p class\\="xis-paragraph">Prioridade baixa\\: utiliza &lt;\\= 10% das colunas quando existem 100 ou mais colunas numa origem de dados</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção de título automático poderá não ser aplicada a alguns objetos, por exemplo, os valores chave.</p></section>',
        "vaeua-gui-eua.Properties.factmac.learnStep.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o tamanho dos passos de aprendizagem para o algoritmo SGD. Uma aprendizagem mais lenta pode evitar o sobreajuste do modelo. O valor do passo de aprendizagem pode ser ajustado para garantir que o algoritmo de otimização converja de forma eficiente.</p></section>',
        "vaeua-gui-eua.Properties.predAuto.numGroups.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.svm.customPenaltyValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a valor de penalização to use. Geralmente, um valor de penalização maior resulta em menos vetores de suporte.</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBins.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
