        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.maxNodeCount.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tenta criar a rede bayesiana ingénua aumentado de árvore, que inclui uma ligação direta entre a variável de resposta e cada preditor, bem como a estrutura de árvore entre os preditores. As redes bayesianas ingénuas aumentadas de árvore exigem que o número máximo de elementos principais seja sempre dois.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.maxNodeCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a granularidade do esquema de rede.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tenta criar uma rede bayesiana de elementos principais e subordinados, que alarga a rede bayesiana ingénua. Esta extensão permite que os preditores sejam elementos principais da variável de resposta, ligações entre os elementos principais e subordinados da variável de resposta, e ligações entre os elementos subordinados da variável de resposta.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.ReportReview.HighReportHeaderObjectCount.help.tip.txt": "Mais informações acerca desta opção ",
