        "vaeua-gui-eua.Properties.svm.customToleranceValue.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a profundidade para os agrupamentos de percentis que são utilizados para calcular determinadas estatísticas. Estas estatísticas podem incluir a média observada, lift, lift cumulativo, percentagem cumulativa de capturados e percentagem cumulativa de eventos.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica se as ligações entre os nós são direcionadas (unidirecionais) ou não direcionadas (bidirecionais). O tipo de ligação afeta o cálculo das métricas de rede. Quando as setas de ligação são apresentadas, o tipo de ligação determina a direção das setas de ligação.</p></section>',
