        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.maxPolylines.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número máximo de polilinhas que podem ser geradas pelo algoritmo de coordenadas paralelas. Aumentar este valor permite um agrupamento mais detalhado.</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBinsCategory.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.lasso.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Visualização de valores de marcas de escala</span> especifica o método utilizado para ajustar os valores de marcas de escala no eixo X. Pode selecionar <span class\\="xis-windowItem">Reduzir automaticamente a sobreposição</span> ou <span class\\="xis-windowItem">Orientação Fixa</span>.</p><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Reduzir automaticamente a sobreposição</span> só é aplicada quando os valores de marcas de escala se sobrepõem. Pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Eliminar alguns</span></td><td>diminui alguns valores de marcas de escala.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotação de 45°</span></td><td>roda todos os valores de marcas de escala 45° na diagonal.</td></tr></table></div>                 </div><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Orientação fixa</span> é sempre aplicada e define a orientação dos valores. Pode especificar o seguinte\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Horizontal</span></td><td>apresenta os valores das marcas de escala horizontalmente.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotação de 45°</span></td><td>roda todos os valores de marcas de escala 45° na diagonal.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rodar 45°, eliminar</span></td><td>roda todos os valores de marcas de escala 45° na diagonal e depois elimina valores de marcas de escala.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.interactionEffect.complete.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Alarga o modelo para incluir observações com valores em falta. Um efeito contínuo é imputado com a média observada e uma variável indicadora que denota que é criada uma omissão. Um efeito de classificação trata os valores em falta como um nível distinto. </p></section>',
