        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Mostra as categorias mais recomendadas ou menos recomendadas para cada variável de categoria. É necessário atribuir pelo menos um preditor antes de poder selecionar um preditor.</p></section>',
