        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de clusters a criar, ou especifica que deve ser usado o método ABC (aligned box criterion) para derivar o melhor número possível de clusters.</p><p class\\="xis-paragraph">O método ABC escolhe primeiro um número de clusters a criar, cria os clusters e calcula a diferença estatística para cada cluster. Em seguida, é criada uma distribuição de referência orientada em torno de cada cluster e é calculada a estatística Gap para cada distribuição de referência. Este processo é repetido para todo o número potencial de clusters. O número de clusters que maximiza a total diferença entre a estatística Gap dos clusters e os dados de referência é escolhido como o melhor número possível de clusters.</p><p class\\="xis-paragraph">O método ABC só é válido quando todas as entradas são variáveis de medida.</p></section>',
