        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utiliza o número predefinido de preditores a tentar para cada divisão. A predefinição é a raiz quadrada do número total de preditores. Caso contrário, especifique o número de preditores a tentar para cada divisão.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de agrupamentos a usar para categorizar as variáveis de medida no gráfico de Dependência Parcial.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ativa o algoritmo de agregação de média k e ignora a ordenação do agrupamento. Não selecione esta opção se quiser utilizar o algoritmo de pesquisa ávido e respeitar a ordenação do agrupamento. As respostas de medida não agrupadas utilizam a variação como critério de seleção. Com esta opção ativada, as respostas categóricas e as respostas de medida agrupadas utilizam o critério de rácio de ganho. Caso contrário, é utilizado o ganho absoluto.</p></section>',
