        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tenta criar a rede bayesiana ingénua e uma rede bayesiana ingénua aumentada com uma rede bayesiana. Um rede bayesiana ingénua especifica que a variável de resposta é o único elemento principal para todos os preditores. Assume a independência condicional de todos os preditores, dada a variável de resposta. Uma rede bayesiana ingénua aumentada com rede bayesiana alarga a rede ingénua ao permitir que os nós de preditor formem uma rede bayesiana.</p></section>',
