        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o nível de personalização que cada utilizador pode fazer à sua vista do relatório. Cada nível inclui os níveis abaixo dele.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Gera etiquetas HTML personalizadas para que o objeto ou relatório possam ser incorporados numa página web.</p><p class\\="xis-paragraph">Para ativar etiquetas personalizadas na sua página web, deve também adicionar etiquetas de &lt;script&gt; ao cabeçalho da sua página. Para mais informações sobre a incorporação de conteúdo de SAS Visual Analytics, consulte a <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">documentação do SAS Visual Analytics SDK</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Espaçamento de agrupamentos</span> controla a largura do espaçamento entre os agrupamentos para barras agrupadas. Se quiser alterar o espaço entre as barras, especifique a opção <span class\\="xis-windowItem">Espaçamento</span>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">O tipo de grupo <span class\\="xis-windowItem">Valores Distintos</span> só está disponível para medidas que tenham um número inferior de valores únicos.</p></section>',
