        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aumenta a árvore de decisão através dos dados de treino e poda a árvore de decisão utilizando o algoritmo de complexidade de custo aplicado aos dados de validação.</p></section>',
