        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Cria a estruturas de rede especificadas, iterando ao longo do número de elementos principais desde 1 até ao valor do número máximo de elementos principais. A rede com a melhor taxa de classificações erradas está selecionada.</p></section>',
