        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o grau de sensibilidade que é usado para identificar valores extremos. Uma definição de sensibilidade mais alta identifica tipicamente mais valores como sendo extremos.</p></section>',
