        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica que os utilizadores saltam o ecrã de início de sessão usam automaticamente credenciais de convidado. Para os utilizadores com credenciais de convidado, o estado de visualização não persiste entre sessões e as preferências do utilizador não estão disponíveis.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a profundidade máxima da árvore, em que o nó de raiz é o nível 1.</p></section>',
