        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o valor máximo inicial (limite superior) para o controlo. O valor inicial é selecionado na primeira vez que um utilizador abre o relatório, ou quando um utilizador seleciona <span class\\="xis-windowItem">Restaurar estado de relatório predefinido</span>. </p><div class\\="xis-paragraph">Introduza um valor no campo de texto ou especifique uma das seguintes opções\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">especifica que a seleção é guardada como valor inicial quando se guarda o relatório. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valor Máximo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o maior valor no controlo é o valor inicial.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o valor do parâmetro que selecionar é o valor inicial para o controlo.</p><p class\\="xis-paraSimple">Só pode selecionar um parâmetro se já existir um parâmetro com o tipo de dados apropriado.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Especifica a forma como o trânsito é utilizado para calcular o tempo de deslocação para a caraterística gráfica. Selecione uma das seguintes opções\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Não</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o cálculo do tempo de deslocação utiliza uma média ponderada dos dados históricos de trânsito para todas as horas do dia e para todos os dias da semana.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Trânsito atual</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Especifica que o cálculo do tempo de deslocação usa condições de trânsito atuais. Estes dados de trânsito podem ser atualizados premindo <span data-icon-name\\="refresh" alt\\="o ícone Atualizar dados de trânsito" aria-label\\="o ícone Atualizar dados de trânsito"></span>. Quando um utilizador visualiza o relatório, o trânsito não é atualizado automaticamente. O utilizador deve atualizar os dados de trânsito para refletir as condições de trânsito mais recentes.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Trânsito normal</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> especifica que o cálculo de tempo de deslocação usa o trânsito normal para a hora e o dia da semana especificados. As condições de trânsito normais baseiam-se em dados históricos recentes.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Nota\\:</span> A hora especificada é a hora local para a localização no mapa.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Nota\\:</span>A obtenção de dados de tempo de deslocação consome créditos Esri Premium Services.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Nota\\:</span>Se não estiverem disponíveis dados de trânsito para a área que contém o cálculo do tempo de deslocação, os limites de velocidade publicados são usados para calcular o tempo de deslocação.</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
