        "vaeua-gui-eua.sas.van.splineEffect.twoWay.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Efeitos compostos a partir de cada par de itens selecionados. Este efeito requer pelo menos dois itens.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Selecione a variável a usar para dividir o nó. As variáveis são ordenadas por logworth, que mede a eficácia com que a variável divide os dados. Logworth é o registo negativo do valor p a partir do teste de chi-square.</p></section>',
