        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ajustar o esquema do seu relatório para evitar contentores agrupados e eliminar os problemas seguintes. Por exemplo, para eliminar problemas de prioridade alta, certifique-se de que existem 6 ou menos contentores agrupados no esquema do seu relatório.</p><p class\\="xis-paragraph">Prioridade baixa\\: contém &gt; 2 contentores agrupados</p><p class\\="xis-paragraph">Prioridade média\\: contém &gt; 4 contentores agrupados</p><p class\\="xis-paragraph">Prioridade alta\\: contém &gt; 6 contentores agrupados</p></section>',
