        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.termWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Controla a forma como é ponderado o peso dos termos. O peso de um termo é um número positivo que é atribuído a cada termo com base na distribuição desse termo na coleção de documentos. Este peso pode ser interpretado como uma indicação da importância desse termo para a coleção de documentos.</p></section>',
