        "vaeua-gui-eua.Properties.predAuto.numFactors.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica se os grupos devem ser calculados e se os três grupos de cima e de baixo devem ser apresentados nos resultados. Algumas árvores de decisão são executadas sobre a variável de resposta especificada, e cada grupo descreve uma folha de uma dessas árvores de decisão.</p></section>',
        "vaeua-gui-eua.Properties.assessment.cutoff.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o critério de convergência para o componente de gradação máximo.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o erro de validação máximo aceitável para concluir o treino do modelo. Quando o erro de validação for inferior ao valor de objetivo especificado, o treino do modelo é terminado.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.standardization.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a função de distribuição utilizada para modelar a variável de resposta.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Rotação de estilos de elemento de dados</span> especifica a forma como o estilos são atribuídos aos elementos de dados no template de gráfico. Por exemplo, num gráfico de linhas, esta opção especifica a forma como as cores, padrões de linhas e marcadores são usados para distinguir entre linhas no gráfico. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automático</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">utiliza a definição de rotação de estilos do tema. A maioria dos temas SAS usam a definição <span class\\="xis-windowItem">Rodar todas as cores primeiro</span>. O tema High Contrast utiliza a definição <span class\\="xis-windowItem">Rodar todos os atributos</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rodar todas as cores primeiro</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">mostra um preenchimento sólido, uma linha sólida e uma forma de marcador coerente até que tenham sido usadas todas as cores na palete.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rodar todos os atributos</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">mostra diferentes padrões de preenchimento, padrões de linha e formas marcador para além de cores diferentes Esta definição pode melhorar a acessibilidade para utilizadores com discromatopsia (daltonismo).</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o parâmetro de escala (coeficiente) na função sigmoide.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica o número de comunidades (agrupamentos de nós locais) a calcular em cada cluster de nós. Note que o número total de comunidades calculado pode ser inferior ao valor selecionado, consoante a estrutura e o tamanho da rede.</p></section>',
        "vaeua-gui-eua.Properties.logisticRegression.functionConversion.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.gamNPLR.funcConv.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.assessment.numberOfBinsCategory.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.gam.dist.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a função de distribuição utilizada para modelar a variável de resposta.</p></section>',
        "vaeua-gui-eua.Properties.generalizedAdditive.fConvValue.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.models.usePartition.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.glm.linkFunction.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Especifica a função de ligação usada para relacionar o modelo linear generalizado com a distribuição da variável de resposta.                 </p></section>',
        "vaeua-gui-eua.barLabelFitPolicy.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Os preditores categóricos tratam um valor em falta como um valor separado. Um preditor contínuo substitui um valor em falta pela média do preditor. Para redes bayesianas, os valores em falta não são incluídos na variável de resposta.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "Mais informações acerca desta opção ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">A opção <span class\\="xis-windowItem">Escala de agrupamento</span> determina a forma como dimensionar gráficos de barras agrupadas. As barras podem ser empilhadas ou colocadas em clusters. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valores reais</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">dimensiona as barras com base nos valores dos dados. Por exemplo, suponha que uma barra num grupo tem um valor de 50 e uma barra noutro grupo tem um valor de 500. A barra de 500 seria 10 vezes mais alta que a barra de 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normalizar grupos para 100%</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> apresenta os grupos utilizando uma escala relativa. Num grupo, cada barra é apresentada como uma percentagem do grupo. Por exemplo, suponha que um grupo tem um valor total de 100. Se uma barra dentro desse grupo tiver um valor de 50, a barra tem 50% da altura do grupo geral.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Esta opção não está disponível quando o objeto de gráfico contém elementos de gráfico sobrepostos. A opção também não está disponível quando especifica o mesmo intervalo de dados para os eixos numa parcela.</p></section>',
        "vaeua-gui-eua.connectOrder.help.aria.txt": "Ajuda. Mais informações acerca desta opção ",
